(1, '7747251666', 'Free Estimate! Local, Insured, Sameday Appliance Repair Service', '1715886401-76349.jpg', 'Atlanta Metro Area', '30022', 'Hi, dear customer!\r\n\r\nAre you appliances giving you trouble? Don\'t worry, our team of expert technicians can help you. \r\nCall us today (404) 341-0808 to schedule your repair appointment.\r\n\r\nWe specialize in repairing all major appliances, including\r\n- refrigerators, freezers, small refrigerators, wine coolers\r\n- washers, dryers,\r\n- ovens, stoves, cooktops,\r\n- dishwashers.\r\n\r\nWe do all major brands including:\r\nWhirlpool, GE, Hotpoint, Samsung, LG, Maytag, Amana, Admiral, Roper, Kenmore, KitchenAid, Bosch, Electrolux, Thermador, Sub Zero, Wolf, Viking, JennAir and etc\r\n\r\nHere what\'s we offer:\r\n* Free Service Call. We do not charge for diagnostic, estimate, trip charge (Exceptions: Commercial Appliances, Dishwashers, LG Refrigerators, Samsung and GE Washers). You pay only for repair cost and for the parts (if you need it). If you decline technician\'s estimate you do not pay any fees.\r\n* Same-next Day Service: We understand that appliance problems can be frustrating, which is why we offer same-day service whenever possible. We\'ll do our best to get your appliances up and running as quickly as possible.\r\n* Competitive Pricing\r\n* Licensed, Insured, Experienced Technicians\r\n* 3-12 Months Warranty on Parts and Labor\r\n\r\nDon\'t let appliance problems stress you out. Call us today (404) 341-0808 to schedule your repair appointment. We look forward to helping you!\r\n', 'cl_mail_relay', 1, 1, 1, '(404) 341-0808', '', '', 6, '2024-05-15 08:52:00', '2024-05-16 15:11:22', '2024-05-16 16:06:41'),
